e moment of his birth his life would be filled wall-to wall with music (his father having listed his religion as "musician" on Dweezil's birth certificate). Dweezil's early years were spent largely away from the spotlight—something of a rarity for the child of a celebrity, but perfect for cultivating a close relationship with his family.

